import { Link } from 'react-router-dom';

const Header = (props) => {
    return (
        <div>
            <nav className='navbar navbar-expand-lg bg-dark'>
                
                <li className="nav-item active" style={{listStyleType: "none"}}> <Link to="/">Home</Link> </li>

                <li className="nav-item active" style={{listStyleType: "none"}}> <a style={{color:"white"}} href="/issues" class='nav-link'>Issues</a></li>

            
            
            
            </nav>
            
        </div>
    )
}

export default Header
